import React, { Component } from 'react';

import Card from 'react-bootstrap/Card'

class PlayerCard extends Component {
    render() {
        return (
            <Card style={{ width: '18rem'}}>
                <Card.Body>
                    <Card.Title>{this.props.info.name}</Card.Title>
                    <Card.Text>{this.props.info.player_type}</Card.Text>
                    <Card.Text>{this.props.info.cost}</Card.Text>
                    <Card.Text>{this.props.info.movement_allowance}</Card.Text>
                    <Card.Text>{this.props.info.strength}</Card.Text>
                    <Card.Text>{this.props.info.agility}</Card.Text>
                    <Card.Text>{this.props.info.armour_value}</Card.Text>
                    <Card.Text>{this.props.info.skills}</Card.Text>
                </Card.Body>
            </Card>
        )
    }
}

export default PlayerCard
